import Image from "./Image.js";
import React from 'react';
import {Helmet} from 'react-helmet';

export default function App() {
  return (
    <div>
    <Helmet>
      <style>{'body { background-color: lightblue; }'}</style>
    </Helmet>
    <ul style={{
      color: 'black'
    }}>
      <h1>Merry Christmas!</h1>
    </ul>
    <Image
        size={1}
        icon={{
          name: 'Christmas Pepe',
          imageId: 'c76UqNN',
          url: 'https://external-content.duckduckgo.com/iu/?u=http%3A%2F%2Fwww.clipartbest.com%2Fcliparts%2F4i9%2FLjM%2F4i9LjM6GT.png&f=1&nofb=1',
          width: 200,
          height: 200,
          top: '50%',
          left: '50%',
          transform: 'translate(-50%, -50%)'
        }} />
    </div>
  );
}
